(function(c){var b=PhpDebugBar.utils.makecsscls("phpdebugbar-widgets-");var a=PhpDebugBar.Widgets.TemplatesWidget=PhpDebugBar.Widget.extend({className:b("templates"),render:function(){this.$status=c("<div />").addClass(b("status")).appendTo(this.$el);this.$list=new PhpDebugBar.Widgets.ListWidget({itemRenderer:function(d,e){c("<span />").addClass(b("name")).text(e.name).appendTo(d);if(e.render_time_str){c('<span title="Render time" />').addClass(b("render-time")).text(e.render_time_str).appendTo(d)}if(e.memory_str){c('<span title="Memory usage" />').addClass(b("memory")).text(e.memory_str).appendTo(d)}if(typeof(e.param_count)!="undefined"){c('<span title="Parameter count" />').addClass(b("param-count")).text(e.param_count).appendTo(d)}if(typeof(e.type)!="undefined"&&e.type){c('<span title="Type" />').addClass(b("type")).text(e.type).appendTo(d)}if(e.params&&!c.isEmptyObject(e.params)){var g=c('<table><tr><th colspan="2">Params</th></tr></table>').addClass(b("params")).appendTo(d);for(var f in e.params){if(typeof e.params[f]!=="function"){g.append('<tr><td class="'+b("name")+'">'+f+'</td><td class="'+b("value")+'"><pre><code>'+e.params[f]+"</code></pre></td></tr>")}}d.css("cursor","pointer").click(function(){if(g.is(":visible")){g.hide()}else{g.show()}})}}});this.$list.$el.appendTo(this.$el);this.bindAttr("data",function(e){this.$list.set("data",e.templates);this.$status.empty();var d=e.sentence||"templates were rendered";c("<span />").text(e.templates.length+" "+d).appendTo(this.$status);if(e.accumulated_render_time_str){this.$status.append(c('<span title="Accumulated render time" />').addClass(b("render-time")).text(e.accumulated_render_time_str))}if(e.memory_usage_str){this.$status.append(c('<span title="Memory usage" />').addClass(b("memory")).text(e.memory_usage_str))}})}})})(PhpDebugBar.$);